					<div className={"flex justify-between mt-2"}>
						<Card currency={"USD"} amount={"$10,250.00"} cardName={"Personal account"} />
						<Card currency={"EUR"} amount={"$10,250.00"} cardName={"Personal account"} />
						<Card currency={"USD"} amount={"$10,250.00"} cardName={"Personal account"} />
					</div>
				</div>

				<div className={"mt-4"}>
					{"Activity"}
				</div>
			</div>

		);
}

export default Dashboard;
